import React,{useState} from "react";
import List from '@material-ui/core/List';
import ListItem from '@material-ui/core/ListItem';
import ListItemText from '@material-ui/core/ListItemText';

import './styles.scss';

function ListStarships(props) {
  const [timeCool, setTimeCool] = useState(0);
  const ships = [];
  const stops = () => {
     // eslint-disable-next-line 
    props.allShips.map((item) => {
      const consumables = item.consumables.split(' ');
        let time = 0;

        switch (consumables[1]) {
        case 'day':
          case 'days':
          time = parseInt(consumables[0]) * 24;
          break;
          case 'week':
        case 'weeks':
            time = parseInt(consumables[0]) * 168;
          break;
          case 'month':
          case 'months':
          time = parseInt(consumables[0]) * 730;
          break;
          case 'year':
        case 'years':
            time = parseInt(consumables[0]) * 8760;
            break;
        default:
            time = 0;
          break;
        }
        if (item.MGLT !== 'unknown') {
					ships.push({ mglt: item.MGLT, consumables: time });
				}
    });
    return ships;
  }

  return (
    <>
       <section>
        <List component="nav" aria-label="main mailbox folders">
          {props.allShips.map(item => item && item.name ? 
            <ListItem className="ships">
              <ListItemText className="shipsName">{item.name} - Will make {1000000 / (item.MGLT * timeCool)} {console.log(stops())}stops</ListItemText>
            </ListItem> : <p></p>)
          }
        </List>
      </section>
    </>
  );
};

export default ListStarships;
